    "Compact Wireless BioMetric Monitoring and Real Time Processing System Project",nt"tracking_summary":
    {ntt"total": 10,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:13:10.399414",nt"name": "compact-wireless-biometric-monitoring-and-real-time-processing-system-project-257cc",nt"isopen":
    true,nt"url": null,nt"notes": "BioWATCH is a modular ambulatory compact
    wireless biomedical data acquisition system.  More specifically, it is a data acquisition
    unit for acquiring signals from biomedical sensors using modular acquisition modules
    attached to a common data and power bus. Several module slots allow the user to
    configure the unit by inserting sensor specific modules. The data is then sent real
    time from the unit over any commercially implemented wireless network including
    802.11b/g, WCDMA, GSM, or EDGE. BioWATCH is of a distributed computing hierarchy
    and has a common data controller on each sensor module.  This innovation allows
    for the modularity of the device along with the tailored ability to control the
    cards using a relatively small master processor.  The distributed nature of this
    system affords the modularity, size, and power consumption that betters the current
    state-of-the-art in medical ambulatory data acquisition. The current state-of-the-art
    in biomedical data monitoring is limited in its modularity and relies on centralized
    computing models. ",nt"license_title": "U.S. Government Work",nt"extras":
